import React from 'react'
import ReactDOM from 'react-dom'


const Hello = (props) => {
    return (
        <div>
        <p>Hello {props.name}, you are {props.age} years old</p>
    </div>
    )
}
const App = () => {
    const ika = 10
    const nimi = "Pekka"
    return (
        <div>
            <h1>Greetings</h1>
            <Hello name="Arto" age={10+26}/>
            <Hello name={nimi} age={ika}/>
            <Hello />
        </div>
    )
}
ReactDOM.render(<App />, document.getElementById('root'))
